def compare(dic,a,b):
    return dic[a]<dic[b]

def quickSort(dic, arr, left=None, right=None):
    left = 0 if not isinstance(left,(int, float)) else left
    right = len(arr)-1 if not isinstance(right,(int, float)) else right
    if left < right:
        partitionIndex = partition(dic, arr, left, right)
        quickSort(dic, arr, left, partitionIndex-1)
        quickSort(dic, arr, partitionIndex+1, right)
    return arr

def partition(dic, arr, left, right):
    pivot = left
    index = pivot+1
    i = index
    while  i <= right:
        if compare(dic, arr[i] , arr[pivot]):
            swap(arr, i, index)
            index+=1
        i+=1
    swap(arr,pivot,index-1)
    return index-1

def swap(arr, i, j):
    arr[i], arr[j] = arr[j], arr[i]